You can use localeCompare with the sensitivity option set to 'case' :
var a = ['a', 'A', 'b', 'B', 'c', 'C'];
a.sort((a, b) => a.localeCompare(b, undefined, { sensitivity: 'case' }));
console.log(a);
// output: ["a", "A", "b", "B", "c", "C"]
